import React from 'react';

export default function CustomerDetails({ customer }) {
  return (
    <div>
      <p>name: {customer.name}</p>
      <p>id: {customer.id}</p>
      <p>address: {customer.address}</p>
      <p>phoneNumber: {customer.phoneNumber}</p>
      <p>plateNumber: {customer.plateNumber}</p>
    </div>
  );
}
